import React from 'react';

function Hero() {
  return (
    <div className="text-center mt-5">
      <h2>Welcome to GreenGoods!</h2>
      <p>Your favorite plant store</p>
      <h4 className="text-success">“Grow green, live clean – one plant at a time!”</h4>
    </div>
  );
}

export default Hero;
